Style.advanced:
/* Global Overrides */

@import url("https://fonts.googleapis.com/css?family=Montserrat:300,400,700");
.component-build-view > .border-div > .app-div {
	overflow-y: scroll;
}

.quick-view .document-view-div .document-view .screen-view.panel > .worksheet {
	overflow: hidden;
}

.panel .grid-stack > .grid-stack-item.build-off {
	border: 0px !important;
}



div.kx-demohub {
	color: #000000;
	font-family: "Montserrat", sans-serif !important;
	max-width: 100vw;
}

div.kx-demohub .bg-mask {
	position: absolute;
	top: 0px;
	bottom: 0px;
	left: 0px;
	right: 0px;
	background-repeat: no-repeat;
	background-position: bottom;
	background-size: cover;
	opacity: 0.5;
	z-index: -1;
}

div.kx-demohub header {
	overflow: hidden;
	position: relative;
}

div.kx-demohub header video {
	position: absolute;
	-webkit-filter: hue-rotate(5deg);
	filter: hue-rotate(5deg);
	z-index: -1;
	bottom: 0px;
	width: 2000px;
	min-height: 100%;
}

div.kx-demohub header .header-content {
	display: flex;
	align-items: center;
	justify-content: space-between;
	padding: 5px 15px 85px 15px;
	color: #ffffff;
}

div.kx-demohub header .header-content .page-title .kx {
	font-weight: 700;
	text-transform: lowercase;
	font-size: 1.1em;
	letter-spacing: -2px;
	padding-right: 5px;
}

div.kx-demohub header .header-content .page-title h1 {
	letter-spacing: 3px;
	font-weight: 300;
	text-transform: lowercase;
	text-shadow: 1px 1px 5px rgba(0, 0, 0, 0.2);
}

div.kx-demohub header .header-content .navigation {
	display: flex;
}

div.kx-demohub header .header-content .navigation a {
	text-transform: uppercase;
	font-weight: 700;
	font-size: 0.85em;
	padding-left: 15px;
	text-decoration: none;
	color: #ffffff;
}

div.kx-demohub header .header-content .navigation a:hover {
	color: #000000;
}

div.kx-demohub .root {
	padding: 0px 15px;
}

div.kx-demohub .root.page {
	margin-top: 25px;
}

div.kx-demohub .root h1 {
	opacity: 0.8;
	font-size: 1.5em;
	text-transform: uppercase;
}

div.kx-demohub .root h2 {
	text-transform: uppercase;
	font-size: 22px;
	padding: 0em 0em .4em 0em;
	margin: 1.33em 0em 0em 0em;
}

div.kx-demohub .root .tile-section {
	display: flex;
	flex-wrap: wrap;
}

div.kx-demohub .root .tile-section.page {
	margin-top: 25px;
}

div.kx-demohub .root .tile-section a {
	flex-grow: 1;
}

div.kx-demohub .root .tile-section a .tile {
	position: relative;
	flex-grow: 1;
	padding: 70px 10px;
	margin: 5px;
	color: #ffffff;
	background-color: #0070cd;
	min-width: 375px;
	text-align: center;
	font-weight: 700;
	font-size: 15px;
	line-height: 17px;
}

div.kx-demohub .root .tile-section a .tile.mock {
	height: 0px;
	margin-top: 0px;
	margin-bottom: 0px;
	padding-top: 0px;
	padding-bottom: 0px;
}

div.kx-demohub .root .tile-section a .tile .mask {
	transition: opacity .2s ease;
	position: absolute;
	top: 0px;
	bottom: 0px;
	left: 0px;
	right: 0px;
	background-color: #000000;
	opacity: 0.5;
}

div.kx-demohub .root .tile-section a .tile:hover {
	cursor: pointer;
}


/* --> Dark Theme &lt;-- */

.content-panel.kx-darkroom div.kx-demohub {
	color: #fcfcfc
}

.content-panel.kx-darkroom div.kx-demohub .bg-mask {
	background-color: #101010
}

.content-panel.kx-darkroom div.kx-demohub .root .tile-section a .tile .mask {
	opacity: 0.3;
}

.content-panel.kx-darkroom div.kx-demohub .root .tile-section a .tile {
	padding: 75px 15px;
	margin: 0px;
}

.content-panel.kx-darkroom div.kx-demohub .root .tile-section a .tile.mock {
	height: 0px;
	margin-top: 0px;
	margin-bottom: 0px;
	padding-top: 0px;
	padding-bottom: 0px;
}


/* --> End Dark Theme &lt;-- */

div.kx-demohub .root .tile-section a .tile:hover .mask {
	opacity: 0 !important;
}

div.kx-demohub .root .tile-section a .tile .content {
	text-align: left;
	position: absolute;
	letter-spacing: 0.05em;
	font-size: 1.5em;
	right: 0px;
	bottom: 0px;
	left: 0px;
	text-shadow: rgba(0, 0, 0, 1) 2px 2px 2px;
	padding: 15px;
}

div.kx-demohub .root .tile-section a .tile .ribbon {
	position: absolute;
	right: -5px;
	top: -5px;
	z-index: 1;
	overflow: hidden;
	width: 75px;
	height: 75px;
	text-align: right;
}

div.kx-demohub .root .tile-section a .tile .ribbon span {
	font-size: 8px;
	font-weight: bold;
	color: #fff;
	text-transform: uppercase;
	text-align: center;
	line-height: 20px;
	-webkit-transform: rotate(45deg);
	transform: rotate(45deg);
	width: 100px;
	display: block;
	background: linear-gradient(#f70505 0%, #8f0808 100%);
	box-shadow: 0 3px 10px -5px black;
	position: absolute;
	top: 19px;
	right: -21px;
}

div.kx-demohub .root .tile-section a .tile .ribbon span::before {
	content: "";
	position: absolute;
	left: 0px;
	top: 100%;
	z-index: -1;
	border-left: 3px solid #8f0808;
	border-right: 3px solid transparent;
	border-bottom: 3px solid transparent;
	border-top: 3px solid #8f0808;
}

div.kx-demohub .root .tile-section a .tile .ribbon span::after {
	content: "";
	position: absolute;
	right: 0px;
	top: 100%;
	z-index: -1;
	border-left: 3px solid transparent;
	border-right: 3px solid #8f0808;
	border-bottom: 3px solid transparent;
	border-top: 3px solid #8f0808;
}

